import LoadingSpinner from "../../shared/components/UIElements/LoadingSpinner";
import { useHttpClient } from "../../shared/hooks/http-hook";

class AllProducts extends Component {
    constructor(props) {
      super(props);
      this.state = {
        items:[],
        isLoaded:false,
      }
    }

  Fetching(){

    fetch('https://jsonplaceholder.typicode.com/users')
          .then(res => res.json())
